import styled from "styled-components";
import Text from "./ui-components/text";
import {Table} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import {useState} from "react";
import {
    SortByEmail,
    SortById,
    SortByLastName,
    SortByLink,
    SortByName,
    SortByPayStatus,
    SortByUsername
} from "./helpers/sort";

const Wrapper = styled.div`
  min-height: 100vh;
  padding: 0 15px;
  display: flex;
  flex-direction: column;
`;

const ModifiedTh = styled.th`
  cursor: pointer;
`;

function App() {
    const [state, setState] = useState([{
        id: 14,
        email: "antonida@mail.com",
        first_name: "Antonida",
        pay_status: false,
        last_name: "White",
        username: "AntonidaW",
        profile_link: "https://fizikl.ru/"
    }, {
        id: 17,
        email: "butonchick@gmail.com",
        first_name: "",
        pay_status: true,
        last_name: "Zorro",
        username: "ananimus007",
        profile_link: "https://translate.google.com/?sl=de&tl=ru&text=Herzlich%20willkommen!&op=translate"
    }, {
        id: 8,
        email: "vasya2007@mail.ru",
        first_name: "Вася",
        pay_status: false,
        last_name: "Пупкин",
        username: "superVasssya",
        profile_link: ""
    }, {
        id: 12,
        email: "antonio@mail.com",
        first_name: "Anton",
        pay_status: true,
        last_name: "Black",
        username: "ABlack",
        profile_link: "https://translate.google.com/"
    }, {
        id: 12,
        email: "antonio@mail.com",
        first_name: "Baton",
        pay_status: true,
        last_name: "Black",
        username: "ABlack",
        profile_link: "https://translate.google.com/"
    },{
        id: 12,
        email: "antonio@mail.com",
        first_name: "Clint",
        pay_status: true,
        last_name: "Black",
        username: "ABlack",
        profile_link: "https://translate.google.com/"
    },])

    const [count, setCount] = useState({
        sortById: 0,
        sortByName: 0,
        sortByLastName: 0,
        sortByUsername: 0,
        sortByEmail: 0,
        sortByPayStatus: 0,
        sortByLink: 0
    });

    const RemoveItem = (id) => {
        setState(state.filter(item => item.id !== id))
    }

    return (
        <Wrapper>
            <div style={{margin: "200px auto", textAlign: "center"}}>
                <Text color={"black"} fontSize={"44px"} fontWeight={600}>
                    Users
                </Text>
                <div style={{marginTop: "20px"}}>
                    <Table striped bordered hover>
                        <thead>
                        <tr>
                            <ModifiedTh onClick={() => SortById(state, setState, count, setCount)}>Id</ModifiedTh>
                            <ModifiedTh onClick={() => SortByName(state, setState, count, setCount)}>First Name</ModifiedTh>
                            <ModifiedTh onClick={() => SortByLastName(state, setState, count, setCount)}>Last Name</ModifiedTh>
                            <ModifiedTh onClick={() => SortByUsername(state, setState, count, setCount)}>Username</ModifiedTh>
                            <ModifiedTh onClick={() => SortByEmail(state, setState, count, setCount)}>Email</ModifiedTh>
                            <ModifiedTh onClick={() => SortByPayStatus(state, setState, count, setCount)}>Pay status</ModifiedTh>
                            <ModifiedTh onClick={() => SortByLink(state, setState, count, setCount)}>Link</ModifiedTh>
                        </tr>
                        </thead>
                        <tbody>
                        {state.map((item, index) => (
                            <tr key={index}>
                                <td>{item.id ? item.id : "-"}</td>
                                <td>{item.first_name ? item.first_name : "-"}</td>
                                <td>{item.last_name ? item.last_name : "-"}</td>
                                <td>{item.username ? item.username : "-"}</td>
                                <td>{item.email ? item.email : "-"}</td>
                                <td>{item.pay_status ? "Оплатил" : "Не оплатил"}</td>
                                <td>
                                    <a href={item.profile_link}>
                                        {item.profile_link && "Тык"}
                                    </a>
                                </td>
                                <ModifiedTh onClick={() => RemoveItem(item.id)}>
                                    <div>
                                        Удалить
                                    </div>
                                </ModifiedTh>
                            </tr>
                        ))}
                        </tbody>
                    </Table>
                </div>
            </div>
        </Wrapper>
    );
}

export default App;
